import { useEffect, useState } from "react";
import axios from "axios";

const ModelGrid = () => {
  // Existing API data (kept even if not shown)
  const [models, setModels] = useState([]);

  // ðŸ”’ MASTER SWITCH â€” controls whether cards appear
  const SHOW_LISTINGS = false;

  useEffect(() => {
    // ðŸ” Keep your existing model controller call
    axios
      .get("/models") // âš ï¸ DO NOT CHANGE (your current controller)
      .then((res) => {
        setModels(res.data || []);
      })
      .catch((err) => {
        console.error("Model fetch error:", err);
      });
  }, []);

  return (
    <section id="profiles" className="profiles">
      <div className="container">
        {/* ================= DIAMOND ================= */}
        <div className="section-head section-head-inline">
          <div>
            <h2>Diamond Escorts From Dubai</h2>
            <p>Ultra-exclusive Dubai companions for VIP clients.</p>
          </div>
        </div>

        <div className="profiles-grid">
          {SHOW_LISTINGS &&
            models.map((model) => (
              <article className="card" key={model._id}>
                <a href={`/model/${model.slug}`} className="card-img">
                  <img
                    src={model.profileImage?.url || "/images/placeholder.jpg"}
                    alt={model.stageName}
                    className="card-img-photo"
                  />
                </a>
              </article>
            ))}
        </div>

        {/* ================= GOLD ================= */}
        <div
          className="section-head section-head-inline"
          style={{ marginTop: "28px" }}
        >
          <div>
            <h2>Premier Gold Escorts From Dubai</h2>
            <p>
              High-class Dubai escorts with a perfect balance of luxury, charm
              and chemistry.
            </p>
          </div>
        </div>

        <div className="profiles-grid">
          {SHOW_LISTINGS &&
            models.map((model) => (
              <article className="card" key={model._id}>
                <a href={`/model/${model.slug}`} className="card-img">
                  <img
                    src={model.profileImage?.url || "/images/placeholder.jpg"}
                    alt={model.stageName}
                  />
                </a>
              </article>
            ))}
        </div>

        {/* ================= TRENDING ================= */}
        <div className="section-head" style={{ marginTop: "28px" }}>
          <h2>New &amp; Trending Escorts From Dubai</h2>
          <p>
            Browse our New &amp; Trending escorts using the pages below. Each
            page shows 6 profiles in a row.
          </p>
        </div>

        <div className="profiles-grid">
          {SHOW_LISTINGS &&
            models.map((model) => (
              <article className="card" key={model._id}>
                <a href={`/model/${model.slug}`} className="card-img">
                  <img
                    src={model.profileImage?.url || "/images/placeholder.jpg"}
                    alt={model.stageName}
                  />
                </a>
              </article>
            ))}
        </div>

        {/* ================= PAGINATION (UNCHANGED) ================= */}
        <div className="pagination">
          <a href="#" className="page-link active">
            1
          </a>
          <a href="#" className="page-link">
            2
          </a>
          <a href="#" className="page-link">
            3
          </a>
          <span className="page-ellipsis">â€¦</span>
          <a href="#" className="page-link">
            Next Â»
          </a>
        </div>
      </div>
    </section>
  );
};

export default ModelGrid;
